import React from "react";
import { Link } from "react-router-dom";

function Button() {
  return (
    <div>
      <button className="btn btn-outline-primary text-center text-light">
        <Link to="/game"> Start the Game! </Link>
      </button>
    </div>
  );
}
export default Button;
